import React from 'react';

const Subscription = () => (
  <div style={{ color: '#E5E7EB', maxWidth: '500px', margin: '0 auto' }}>
    <h2 style={{ color: '#2ECC71', fontWeight: 700, fontSize: '1.7rem', marginBottom: '1.2rem' }}>Subscription</h2>
    <div style={{ background: '#23272F', borderRadius: '1rem', padding: '2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.08)' }}>
      <p style={{ marginBottom: '1.5rem' }}>View, upgrade, or cancel your subscription here.</p>
      <button style={{ background: '#2ECC71', color: '#181A20', border: 'none', borderRadius: '0.5rem', padding: '0.7rem 1.5rem', fontWeight: 700, fontSize: '1rem', cursor: 'pointer' }}>Upgrade (Coming Soon)</button>
      <button style={{ background: '#FF6B35', color: '#fff', border: 'none', borderRadius: '0.5rem', padding: '0.7rem 1.5rem', fontWeight: 700, fontSize: '1rem', cursor: 'pointer', marginLeft: '1rem' }}>Cancel (Coming Soon)</button>
    </div>
  </div>
);

export default Subscription;
